import { Component } from '@angular/core';

@Component({
  selector: 'app-dropdowncard',
  templateUrl: './dropdowncard.component.html',
  styleUrls: ['./dropdowncard.component.css']
})
export class DropdowncardComponent {
}

<h4 class="homeheading">Create Your Journey</h4>

<div class="ddcard">
    <p class="select">Select to what degree you would like to proceed with the Video KYC process</p>
    <button class="primary-btn" href="#form">Create</button>
</div>
<hr class="divider">
